import React from 'react';
import Container from '../components/Container';

export default function Header() {
    return (
        <Container>
            <div className="col">
                <div className="entrance neonText">
                    Hey, I'm Michael.<br />
                    I like dogs.

                </div>
            </div>

        </Container>
    )
}
